import React from "react";

function NavBar() {


  return (
    <>
    <div className="navi">

    <h2 className= "category" onClick="https://megaman.fandom.com/wiki/Proto_Man">
    Official Games
    </h2>

    <h2 className= "category">
    Spin offs
    </h2>

    <h2 className= "category">
    Cameos
    </h2>
    
    </div>
    </>
  );
}

export default NavBar;
